ReactDOM.render(
    <>
     
        <h1 className="heading_style">List of top five web series in 2020</h1> 
        
     {/* { Sdata.map(ncard)} */}
     {/* {Sdata.map(function ncard(val){   or*/}
     {/* {Sdata.map(const ncard =(val) =>  or */}
        {Sdata.map((val, index) => {
            console.log(index);
       return( <Card
               Key={val.id} 
               imgsrc={val.imgsrc}
               title={val.title}
               sname={val.sname}
               link={val.link}
        />)
      }) }
      </> ,document.getElementById("root")
);


